import React, { useState, useEffect, useRef } from "react";
import analysis from "../images/medical-analysis.jpeg"
const { tableau } = window;


function Scenario3(){
  const url = 'https://public.tableau.com/views/Rent_16847608524380/Dashboard3';
  const ref = useRef(null);

  const initViz = () => {
    new tableau.Viz(ref.current, url, {
      width: "100%",
      height: "100%"
    });
  };

  useEffect(initViz, []);

  return (
    <div className="embed">
      <h1 className="embed_heading">Rental rates in Melbourne</h1>
      <div className="viz-container" ref={ref} />
      <div className="content">
      <h1 className="content_heading">Story</h1>
       <div className="image-container">
          <img className="image" src={analysis} alt="Image 1" />
          <p className="image-description">The results of the analysis shows that there is a positive correlation between average sentiment and average Rental expenditure index in each suburb. This means that suburbs with positive average sentiment tend to have higher average Rental expenditure index in each suburb. We have plotted the top 5 sentiments and bottom 5 sentiments based on twitter data. After analysing the average rental affordability index with respect to sentiments calculated we came to the conclusion that Yarrawonga, Victoria has the highest sentiment of 0.17 followed by Geelong, Victoria and Portarlington, Victoria with 0.15 and 0.13 respectively, While the Warrangul, Bendigo and Benalla in Victoria has the lowest sentiments score with score of -0.07, -0.05 and -0.04 respectively. This twitter sentiment score when compared to Sudo data on Rental affordability index of different regions we concluded that Yarrawonga has RAI of 120k while Geelong and Portarlington has RAI of 112k and 109k leading to Top 3 positive sentiments.
The results of this analysis suggest that there is a negative correlation between average sentiment and average expenditure per person.</p>
      </div> 
      </div>
    </div>
  );
}


export default Scenario3;
